import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
    return (
        <div>
            <Link to='/'><button>/page0</button></Link>
            <Link to='/page1'><button>/page1</button></Link>
            <Link to='/page2'><button>/page2</button></Link>
        </div>
    )
}

export default Navbar
